    def ReadFromFiles(self,FilePath):
        if os.path.exists(FilePath):
            with open(FilePath,"r") as f1:
                goods=f1.read()
            list=goods.splitlines()
            for index in range(0,len(list)):
                list[index]=list[index].split(":")
            # list [[name:code:price:quantity],[name:code:price:quantity]]
            return list
        else:
            return []
