    def notifications(self):
        list_limits=self.ReadFromFiles(self.database+"\\limits.txt")
        #   [[code,limit]]
        list_noti=[]
        for list_limit in list_limits:
            for good in self.list_goods:
                if list_limit[0]==good[0]:
                    if int(good[3])<int(list_limit[1]):
                        list_noti.append(good[1]+":"+good[3]+"<"+list_limit[1])
        return list_noti
